Busan An Metropolitan nga Syudad han Busan(부산광역시), nga kilalado gihapon nga Pusan(부산)[1] (ginluluwas nga ˈpuˈsɑn) amo an gidako-i nga puerto o daungan hin barko nga syudad ha Salatan nga Korea. An Busan mayda populasyon nga 3.65 ka milyon ngan amo ini an ikaduha nga gidako-i nga metropolis ha Salatan nga Korea, sunod han Seoul. Nahamutang an syudad ha pinakatimugan nga dapit han Peninsula han Korea ngan naatubang han Estrecho han Korea. An pinaka-damo hin tawo nga mga dapit han syudad nahamutang
..........
tibo nga pagbahinbahin Han 1957 an Busan nagtikang hin paggamit hin pagbahinbahin nga sistema ha paghijmo hin 6 nga gu: Busanjin-gu, Dong-gu, Dongnae-gu, Jung-gu, Seo-gu, ngan Yeongdo-gu. Ha yana, an Busan ginbahinbahin ngadto hin 15 nga gu (mga distrito) ngan 1 nga gun (kondado). - Buk-gu (북구; 北區) - Busanjin-gu (부산진구; 釜山鎭區) - Dong-gu (동구; 東區) - Dongnae-gu (동래구; 東萊區) - Gangseo-gu (강서구; 江西區) - Geumjeong-gu (금정구; 金井區) - Haeundae-gu (해운대구; 海雲臺區) - Jung-gu (중구; 中區) - Nam-gu (남구; 南區) - Saha-gu (사하구;
